from typing import List

class Node:

    def __init__(self, tag_type, attributes):
        self.tag_type = tag_type
        self.attributes = attributes

def process_nodes(nodes: List[Node], stop_on_next: bool, tagid_required: bool) -> List[Node]:
    filtered_nodes = []
    for node in nodes:
        if stop_on_next:
            if (tagid_required and 'TAGID' in node.attributes) and (not tagid_required and node.tag_type == 'UNPAIRED_TAG'):
                filtered_nodes.append(node)
    return filtered_nodes

